import styled from 'styled-components'

export const Wrapper = styled.header`
    background-color: #00378b;
    text-transform: uppercase;
    color: #ffffff;
    text-align: center;
    .Wrapper {
        .Wrapper__title-container {
            h1 {
                font-size: 25px;
                margin: 0;
            }
        }
    }
`
